  `first_menu` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `idx_rest_first_price` (`first_price`)
) ENGINE=InnoDB AUTO_INCREMENT=3052 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
